import React from "react";
import styled from "styled-components";
import NavBar from "./navBar";
import "../App.js";
export default function Footer() {
  return (
    <FooterContainer>
      <NavBar />
      <div>
        <Atag className="icon">
          <i className="fa fa-facebook"></i>
        </Atag>
        <Atag className="icon" href="#">
          <i className="fa fa-twitter"></i>
        </Atag>
      </div>
    </FooterContainer>
  );
}

const Atag = styled.a`
  width: 40px;
  height: 40px;
`;

const FooterContainer = styled.footer`
  background: grey;
  height: 4rem;
  position: fixed;
  left: 0;
  bottom: 0;
  width: 100%;
  height: 35%;
`;
